import React, { FC } from 'react';
import {Link, Redirect, Route, Switch, useLocation } from "react-router-dom";
import { Layout, Menu, Typography } from 'antd';
import * as Navigation from './navigatoin';
import './App.css';



const App = () => {
  const location = useLocation();
  const title = "Inconspicuous Encryption";

  return (
    <>
        <Layout className="App" style={{ height: "100%" }}>
          <Layout.Sider 
            style={{ 
              background:"#11274c",
              width:"120%"
            }}>
            <Typography style={{width:"110%"}}>

              <Typography.Title
                level={4}
                style={{
                    margin: 25,
                    color:"white",
                    background:"#11274c",
                    fontSize:"x-large",
                  }}
                >
                {title}
              </Typography.Title>
            </Typography>
            <Menu
              mode="inline"
              selectedKeys={selectedMenuKeys(location.pathname)}
              style={{
                background:"#11274c",
                color:"white",
                minHeight: "100vh",
                boxSizing:"border-box",
                width:"110%"
              }}
            >
              <Menu.Item
                key={Navigation.HOME}
              >
                <Link 
                  to={Navigation.HOME}
                  style={{color:"white"}}
                >
                  Home
                </Link>
              </Menu.Item>
              <Menu.Item
                key={Navigation.ENCRYPT}
              >
                <Link
                  to={Navigation.ENCRYPT}
                  style={{color:"white"}}
                >
                  Encrypt
                </Link>
              </Menu.Item>
              <Menu.Item
                key={Navigation.DECRYPT}
                style={{}}
              >
                <Link 
                  to={Navigation.DECRYPT}
                  style={{color:"white"}}
                >
                  Decrypt
                </Link>
              </Menu.Item>

            </Menu>
          </Layout.Sider>
        </Layout>
    </>
  );
}

function selectedMenuKeys(pathname: string): string[] {
  return [];
}

export default App;
